  .block {
    --padding-vertical: 5rem;
    padding: var(--padding-vertical) 2rem;
  }

  .block__header {
    text-align: center;
    margin-bottom: 4rem;
  }

  .block__heading {
    margin-top: 0;
  }

  .block--dark {
    background: #000;
    color: #7b858b;
  }

