  .nav {
    background: #000;
    display: flex;
    justify-content: space-between;
    flex-wrap: wrap;
    padding: 1rem;
    align-items: center;
  }

  .nav__list {
    width: 100%;
    margin: 0;
  }

  .nav__item {
    padding: 0.5rem 2rem;
    border-bottom: 1px solid #222;
  }

  .nav__item:last-of-type {
    border-bottom: none;
  }

  .nav__item>a {
    color: #d2d0db;
    transition: color 0.3s;
  }

  .nav__item>a:hover {
    color: #fff;
  }

